import React, {Component} from 'react';
import './Birds.css'


class Birds extends Component {


    clickResult(item) {
        this.props.answerData(item)
    }

    render() {
        const {data, clazzAns,data2} = this.props;
        let clazz = '';
        // if (clazzAns) {
        //     clazz = clazz + 'success'
        // } else {
        //     clazz = clazz + 'error'
        // }
        return (
            <ul className="item-list list-group">
                {data.map((item) => (
                    <li className={`list-group-item ${item.id===data2?'success':data2===''?'':'error'}`} key={item.id} onClick={() => this.clickResult(item)}>
                      <span className={'li-btn'}>
                      </span>
                        {item.name}
                    </li>
                ))}
            </ul>
        );
    }
}

export default Birds;
